  false,\n\t\"url\": null,\n\t\"notes\": \"Although numbers are increasing at the
  present time the Greater Sandhill Crane has disappeared from much of its former
  range. Coues (1883) reported that in 1792, Jeremy Belknap listed thesandhill crane
  as a New Hampshire bird species, and Samuel Williams reported that it was one of
  the most common \"waterfowl\" in Vermont. Stone (1937) stated that in 1748-49 cranes
  headed north over Cape May, New Jersey and that in 1670 cranes came in numbers.
  Since that time cranes have become rare in New England and the Atlantic Coast states.
  Much of their former breeding range was destroyed as settlement progressed westward.
  Drainage of marshes, cultivation and human disturbance resulted in this reduction,
  especially in the Prairie states.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
